using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using API.Models;
using API.ViewModels;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace Tests.Controllers
{
    [TestClass]
    public class TempFileControllerTest : BaseControllerTest
    {
        [TestMethod]
        public void Get_Ok_Test()
        {
            var tempFile = _context.TempFiles.First();
            string url = $"/api/tempfile/{tempFile.Id}";
            HttpGet<object>(url);
        }

        [TestMethod]
        public void GetInfo_Ok_Test()
        {
            var tempFile = _context.TempFiles.First();
            string url = $"/api/tempfile/getinfo/{tempFile.Id}";
            var result = HttpGet<TempFileViewModelGet>(url);
            Assert.AreEqual(tempFile.Filename, result.Filename);
        }

        [TestMethod]
        public void Post_Ok_Test()
        {
            var user = _context.Users.First(u => u.Role == Role.PortalAdmin);
            var rndString = Guid.NewGuid().ToString();
            var viewModel = new TempFileViewModelPost
            {
                FormId = rndString,
                Filename = rndString + ".jpg",
                Data = Convert.FromBase64String("")
            };
            string url = $"/api/tempfile";
            var result = HttpPost<TempFileViewModelGet>(url, viewModel, user.AuthToken);
            Assert.IsFalse(String.IsNullOrEmpty(result.Url));
        }

        [TestMethod]
        public void Delete_Ok_Test()
        {
            var user = _context.Users.First(u => u.Role == Role.PortalAdmin);
            var tempFile = _context.TempFiles.Take(10).ToList().Last();
            string url = $"/api/tempfile/{tempFile.Id}";
            HttpDelete<string>(url, user.AuthToken);

            //Восстанавливаем всё как было
            _context.TempFiles.Add(tempFile);
            _context.SaveChanges();
        }

        [TestMethod]
        public void GetByFormId_Ok_Test()
        {
            var tempFile = _context.TempFiles.First();
            string url = $"/api/tempfile/byformid/{tempFile.FormId}";
            var result = HttpGet<IEnumerable<TempFileViewModelGet>>(url);
            Assert.IsTrue(result.Any());
        }

    }
}
